import web3 from './web3';
import CampaignFactory from '../build/contracts/CampaignFactory.json';

const instance = new web3.eth.Contract(
    CampaignFactory.abi,
    '0x8176d1Ca971a21fB40d29b1F75cE484aD55E877F'
);

export default instance
